import React from "react";
import { useNavigate } from "react-router-dom";
import "../App.css";

export default function Third() {
  const navigate = useNavigate();

  return (
    <div className="workflow-step">
      <h1 className="step-heading">Workflow – Step 2</h1>
      <p className="step-text">Preprocessing & Web Scraping</p>

      <h3 className="step-heading">Tool:</h3>
      <p className="step-text">Scrapingdog API Script (under refinement)</p>

      <h3 className="step-heading">Goal:</h3>
      <p className="step-text">
        Ensure accurate data extraction (e.g., correct company names, domains).
      </p>

      <h3 className="step-heading">Responsibility:</h3>
      <p className="step-text">
        Entire team supports refinement and validation.
      </p>

      {/* Arrow Button */}
      <button
        className="arrow-btn"
        onClick={() => navigate("/fourth")}
        aria-label="Go to Next Step"
      >
        ➔
      </button>
    </div>
  );
}
